import './App.css';
import HomePage from './pages/HomePage';
import CoursePage from './pages/CoursePage';

import {
  Routes,
  Route,
  BrowserRouter,

} from 'react-router-dom'


function App() {
  return (
    <div className="App">
      <BrowserRouter>

        <Routes>
            <Route path='/' element={<HomePage />}/>
            <Route path='/course/:name' element={<CoursePage />}/>

        </Routes>        
    </BrowserRouter>

    </div>
  );
}

export default App;
